    [],nt"num_tags": 5,nt"name": "prime-hook-national-wildlife-refuge-annual-narrative-report-calendar-year-1994",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Prime
    Hook National Wildlife Refuge outlines Refuge accomplishments during the 1994 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, fire management, and pest control. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
    other resident wildlife, marking and bird banding, and disease prevention and control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, trapping, and law enforcement. The equipment
    and facilities section of the report provides information about rehabilitation,
    equipment utilization and replacement, computer systems, and energy conservation.
    Cooperative programs are provided at the end. Photographs and Refuge brochures are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
